import { Component, ElementRef, ViewChild, AfterViewInit, OnDestroy, Inject, PLATFORM_ID } from '@angular/core';
import { CommonModule, isPlatformBrowser } from '@angular/common';

interface BoundingBox {
  id: number;
  x: number;
  y: number;
  width: number;
  height: number;
  isMarked?: boolean;
}

interface MarkedTooth {
  boundingBoxId: number;
  x: number;
  y: number;
}

@Component({
  selector: 'app-dental-image-processor',
  imports: [CommonModule],
  templateUrl: './dental-image-processor.html',
  styleUrl: './dental-image-processor.css'
})
export class DentalImageProcessor implements AfterViewInit, OnDestroy {
  @ViewChild('canvas', { static: false }) canvasRef!: ElementRef<HTMLCanvasElement>;
  @ViewChild('previewCanvas', { static: false }) previewCanvasRef!: ElementRef<HTMLCanvasElement>;

  private isBrowser: boolean;

  // Dữ liệu mẫu - thay thế chuỗi base64 này bằng hình ảnh của bạn
  imageBase64: string = this.getDefaultImage();
  boundingBoxes: BoundingBox[] = [
    { id: 1, x: 60, y: 165, width: 10, height: 10 },
    { id: 2, x: 70, y: 120, width: 10, height: 10},
    { id: 3, x: 85, y: 85, width:10, height: 10 },
    { id: 4, x: 102, y: 65, width:10, height: 10 },
    { id: 5, x: 125, y: 55, width:10, height: 10 },
    { id: 6, x: 150, y: 55, width:10, height: 10 },
    { id: 7, x: 173, y: 65, width:10, height: 10 },
    { id: 8, x: 188, y: 85, width:10, height: 10 },
    { id: 9, x: 205, y: 120, width:10, height: 10 },
    { id: 10, x: 215, y: 165, width:10, height: 10 },


    { id: 11, x: 278, y: 80, width: 10, height: 10 },
    { id: 12, x: 288, y: 125, width: 10, height: 10 },
    { id: 13, x: 306, y: 155, width: 10, height: 10 },
    { id: 14, x: 323, y: 175, width: 10, height: 10 },
    { id: 15, x: 343, y: 180, width: 10, height: 10 },
    { id: 16, x: 366, y: 180, width: 10, height: 10 },
    { id: 17, x: 388, y: 175, width: 10, height: 10 },
    { id: 18, x: 405, y: 155, width: 10, height: 10 },
    { id: 19, x: 423, y: 125, width: 10, height: 10 },
    { id: 20, x: 433, y: 80, width: 10, height: 10 },
  ];

  markedTeeth: MarkedTooth[] = [];
  savedImageBase64: string = '';
  
  private canvas!: HTMLCanvasElement;
  private ctx!: CanvasRenderingContext2D;
  private image: HTMLImageElement | null = null;
  private redrawInterval: any;
  private lastCanvasData: string = '';
  canvasWidth = 500;
  canvasHeight = 300;

  constructor(@Inject(PLATFORM_ID) platformId: Object) {
    this.isBrowser = isPlatformBrowser(platformId);
  }

  ngAfterViewInit(): void {
    if (this.isBrowser) {
      // Thêm timeout để đảm bảo DOM đã sẵn sàng
      setTimeout(() => {
        this.initializeCanvas();
        this.loadSampleImage();
      }, 100);
    }
  }

  private initializeCanvas(): void {
    if (!this.isBrowser) return;
    
    try {
      this.canvas = this.canvasRef.nativeElement;
      if (!this.canvas) {
        console.error('Canvas element not found');
        return;
      }
      
      const context = this.canvas.getContext('2d');
      if (!context) {
        console.error('Cannot get 2D context');
        return;
      }
      this.ctx = context;
      
      this.canvas.width = this.canvasWidth;
      this.canvas.height = this.canvasHeight;
      
      // Set canvas style để đảm bảo hiển thị đúng
      this.canvas.style.border = '1px solid #ccc';
      this.canvas.style.display = 'block';
      
      // Thêm event listener cho click
      this.canvas.addEventListener('click', (event) => this.onCanvasClick(event));
      
      console.log('Canvas initialized successfully:', this.canvas.width, 'x', this.canvas.height);
      
      // Bắt đầu interval để kiểm tra canvas
      this.startCanvasMonitoring();
    } catch (error) {
      console.error('Error initializing canvas:', error);
    }
  }

  private loadSampleImage(): void {
    if (!this.isBrowser) return;
    
    // Nếu có base64 image thì load, nếu không thì tạo ảnh mẫu
    if (this.imageBase64) {
      this.loadImageFromBase64(this.imageBase64);
    } 
  }

  

  loadImageFromBase64(base64: string): void {
    if (!this.isBrowser) return;
    
    console.log('Loading image from base64, length:', base64.length);
    
    // Tạo image mới
    const newImage = new Image();
    
    newImage.onload = () => {
      console.log('Image loaded successfully:', newImage.width, 'x', newImage.height);
      // Chỉ gán image sau khi load thành công
      this.image = newImage;
      this.drawCanvas();
    };
    
    newImage.onerror = (error) => {
      console.error('Error loading image:', error);
      alert('Không thể load hình ảnh. Vui lòng kiểm tra chuỗi base64.');
    };
    
    // Set crossOrigin để tránh CORS issues
    newImage.crossOrigin = 'anonymous';
    newImage.src = base64;
  }

  private drawCanvas(): void {
    if (!this.isBrowser || !this.image) {
      console.log('Cannot draw canvas:', { isBrowser: this.isBrowser, hasImage: !!this.image });
      return;
    }
    
    // Kiểm tra canvas và context vẫn còn
    if (!this.canvas || !this.ctx) {
      console.log('Canvas or context lost, reinitializing...');
      this.initializeCanvas();
      if (!this.canvas || !this.ctx) {
        console.error('Failed to reinitialize canvas');
        return;
      }
    }
    
    try {
      console.log('Drawing canvas with image:', this.image.width, 'x', this.image.height);
      
      // Xóa canvas
      this.ctx.clearRect(0, 0, this.canvas.width, this.canvas.height);
      
      // Vẽ ảnh nền
      this.ctx.drawImage(this.image, 0, 0, this.canvas.width, this.canvas.height);
      
      // Vẽ bounding boxes
      this.drawBoundingBoxes();
      
      // Vẽ các dấu X đã đánh dấu
      this.drawMarkedTeeth();
      
      console.log('Canvas drawn successfully');
      
      // Lưu backup của canvas
      this.lastCanvasData = this.canvas.toDataURL();
    } catch (error) {
      console.error('Error drawing canvas:', error);
    }
  }

  private drawBoundingBoxes(): void {
    if (!this.isBrowser) return;
    
    this.ctx.strokeStyle = '#007bff';
    this.ctx.lineWidth = 2;
    this.ctx.setLineDash([5, 5]);
    
    this.boundingBoxes.forEach(box => {
      this.ctx.strokeRect(box.x, box.y, box.width, box.height);
    });
    
    this.ctx.setLineDash([]);
  }

  private drawMarkedTeeth(): void {
    if (!this.isBrowser) return;
    
    this.ctx.strokeStyle = '#dc3545';
    this.ctx.lineWidth = 3;
    
    this.markedTeeth.forEach(tooth => {
      this.drawX(tooth.x, tooth.y);
    });
  }

  private drawX(centerX: number, centerY: number): void {
    if (!this.isBrowser) return;
    
    const size = 15;
    
    this.ctx.beginPath();
    // Vẽ đường chéo từ trái trên xuống phải dưới
    this.ctx.moveTo(centerX - size, centerY - size);
    this.ctx.lineTo(centerX + size, centerY + size);
    
    // Vẽ đường chéo từ phải trên xuống trái dưới
    this.ctx.moveTo(centerX + size, centerY - size);
    this.ctx.lineTo(centerX - size, centerY + size);
    
    this.ctx.stroke();
  }

  private onCanvasClick(event: MouseEvent): void {
    if (!this.isBrowser) return;
    
    const rect = this.canvas.getBoundingClientRect();
    const x = event.clientX - rect.left;
    const y = event.clientY - rect.top;
    
    // Kiểm tra xem click có nằm trong bounding box nào không
    const clickedBox = this.boundingBoxes.find(box => 
      x >= box.x && x <= box.x + box.width &&
      y >= box.y && y <= box.y + box.height
    );
    
    if (clickedBox) {
      // Kiểm tra xem răng này đã được đánh dấu chưa
      const existingMarkIndex = this.markedTeeth.findIndex(
        tooth => tooth.boundingBoxId === clickedBox.id
      );
      
      if (existingMarkIndex >= 0) {
        // Nếu đã đánh dấu thì bỏ đánh dấu
        this.markedTeeth.splice(existingMarkIndex, 1);
        clickedBox.isMarked = false;
      } else {
        // Nếu chưa đánh dấu thì thêm dấu X
        const centerX = clickedBox.x + clickedBox.width / 2;
        const centerY = clickedBox.y + clickedBox.height / 2;
        
        this.markedTeeth.push({
          boundingBoxId: clickedBox.id,
          x: centerX,
          y: centerY
        });
        clickedBox.isMarked = true;
      }
      
      // Vẽ lại canvas
      this.drawCanvas();
    }
  }

  saveImage(): void {
    if (!this.isBrowser) return;
    
    // Lưu ảnh hiện tại (bao gồm cả dấu X) thành base64
    this.savedImageBase64 = this.canvas.toDataURL('image/png');
    
    // Hiển thị preview
    this.showPreview();
  }

  private showPreview(): void {
    if (!this.isBrowser || !this.previewCanvasRef || !this.savedImageBase64) return;
    
    const previewCanvas = this.previewCanvasRef.nativeElement;
    const previewCtx = previewCanvas.getContext('2d')!;
    
    previewCanvas.width = this.canvasWidth / 2;
    previewCanvas.height = this.canvasHeight / 2;
    
    const previewImage = new Image();
    previewImage.onload = () => {
      previewCtx.drawImage(previewImage, 0, 0, previewCanvas.width, previewCanvas.height);
    };
    previewImage.src = this.savedImageBase64;
  }

  clearMarks(): void {
    this.markedTeeth = [];
    this.boundingBoxes.forEach(box => box.isMarked = false);
    this.drawCanvas();
  }

  downloadImage(): void {
    if (!this.isBrowser || !this.savedImageBase64) return;
    
    const link = document.createElement('a');
    link.download = 'dental-image-marked.png';
    link.href = this.savedImageBase64;
    link.click();
  }

  // Phương thức để load ảnh từ bên ngoài
  loadCustomImage(base64: string, boundingBoxes: BoundingBox[]): void {
    this.imageBase64 = base64;
    this.boundingBoxes = boundingBoxes;
    this.markedTeeth = [];
    this.loadImageFromBase64(base64);
  }

  // Phương thức để set hình ảnh base64 mới
  setImageBase64(base64: string): void {
    this.imageBase64 = base64;
    this.markedTeeth = [];
    if (this.isBrowser) {
      this.loadImageFromBase64(base64);
    }
  }

  // Phương thức để load ảnh từ input
  loadImageFromInput(base64: string): void {
    if (!base64 || !base64.trim()) {
      alert('Vui lòng nhập chuỗi base64');
      return;
    }

    // Kiểm tra format base64
    if (!base64.startsWith('data:image/')) {
      alert('Chuỗi base64 không hợp lệ. Phải bắt đầu với "data:image/"');
      return;
    }

    this.setImageBase64(base64.trim());
  }

  // Phương thức để lấy hình ảnh mặc định
  private getDefaultImage(): string {
    // THAY THẾ CHUỖI BASE64 NÀY BẰNG HÌNH ẢNH CỦA BẠN
    return `data:image/jpeg;base64,`;
  }

  // Getter để lấy danh sách răng đã đánh dấu
  getMarkedTeethIds(): number[] {
    return this.markedTeeth.map(tooth => tooth.boundingBoxId);
  }

  // Phương thức để bắt đầu monitoring canvas
  private startCanvasMonitoring(): void {
    if (this.redrawInterval) {
      clearInterval(this.redrawInterval);
    }
    
    this.redrawInterval = setInterval(() => {
      if (this.isBrowser && this.canvas && this.ctx) {
        try {
          // Kiểm tra xem canvas có còn content không
          const imageData = this.ctx.getImageData(0, 0, 10, 10);
          const isEmpty = imageData.data.every(value => value === 0);
          
          if (isEmpty && this.image) {
            console.log('Canvas is empty, redrawing...');
            this.drawCanvas();
          } else if (isEmpty && this.lastCanvasData) {
            console.log('Canvas is empty, restoring from backup...');
            this.restoreFromBackup();
          }
        } catch (error) {
          console.log('Error checking canvas, reinitializing...');
          this.initializeCanvas();
          if (this.image) {
            this.drawCanvas();
          }
        }
      }
    }, 2000); // Kiểm tra mỗi 2 giây
  }

  // Phương thức để restore canvas từ backup
  private restoreFromBackup(): void {
    if (!this.lastCanvasData || !this.canvas || !this.ctx) return;
    
    const backupImage = new Image();
    backupImage.onload = () => {
      this.ctx.clearRect(0, 0, this.canvas.width, this.canvas.height);
      this.ctx.drawImage(backupImage, 0, 0);
      console.log('Canvas restored from backup');
    };
    backupImage.src = this.lastCanvasData;
  }

  // Dọn dẹp khi component bị destroy
  ngOnDestroy(): void {
    if (this.redrawInterval) {
      clearInterval(this.redrawInterval);
    }
  }

  // Phương thức để force redraw canvas
  forceRedraw(): void {
    if (!this.isBrowser) return;
    
    console.log('Force redraw called');
    
    // Kiểm tra và khôi phục canvas nếu cần
    if (!this.canvas || !this.ctx) {
      console.log('Canvas lost, reinitializing...');
      this.initializeCanvas();
    }
    
    // Nếu không có image, tạo lại sample image
    if (!this.image) {
      console.log('Image lost, recreating sample image...');
      this.loadSampleImage();
    } else {
      this.drawCanvas();
    }
  }

  // Phương thức để kiểm tra trạng thái
  checkStatus(): void {
    console.log('Canvas status:', {
      isBrowser: this.isBrowser,
      hasCanvas: !!this.canvas,
      hasCtx: !!this.ctx,
      hasImage: !!this.image,
      imageBase64Length: this.imageBase64.length,
      canvasWidth: this.canvas?.width,
      canvasHeight: this.canvas?.height
    });
  }

  // Getter để lấy base64 của ảnh đã lưu
  getSavedImageBase64(): string {
    return this.savedImageBase64;
  }
}
